const EVENTS = [
  { eventId: 1, title: "Iran 2025" },
  { eventId: 2, title: "Germany 2024" },
  { eventId: 3, title: "Iraq 2025" },
  { eventId: 4, title: "America 2025" },
];

export default function EventsPage() {
  return (
    <>
      <h1 style={{ font: "2rem", color: "white" }}>This is Events Page</h1>;
      {EVENTS.map()}
    </>
  );
}
